import React from 'react'
import { Formik, Field, Form} from 'formik'
import useSignin from './useSignin'
import { userEmail } from '../../types/Types'
import { validationSchema } from '../../validation'

const Signin = () => {
  const {handleSubmit} = useSignin()

  const initial: userEmail = {
    username: "Sincere@april.biz",
    email: "Bret"
  }
  
  return (

    <div style={{width: "100px"}}>
      <h1>Signup</h1>
      <Formik initialValues = {initial}
      validationSchema={validationSchema}
       onSubmit={values => {
          handleSubmit(values)
       }}>
         {({ errors, touched }) => (
         <Form>
          Email
           <Field name="email" validate={validationSchema}/>
           {errors.email && touched.email && <div style={{color: "red"}}>{errors.email}</div>}
           Username
           <Field name="username" validate={validationSchema} />
           {errors.username && touched.username && <div style={{color: "red"}}>{errors.username}</div>}
           <button type="submit">Submit</button>
         </Form>
       )}
       </Formik>
    </div>
  )
}

export default Signin
